CREATE TABLE IF NOT EXISTS Listings (id INTEGER NOT NULL auto_increment , sellerName VARCHAR(255) NOT NULL, email VARCHAR(255) NOT NULL, sellingPrice INTEGER NOT NULL, sqFootage INTEGER NOT NULL, bedrooms INTEGER NOT NULL, areaZip INTEGER NOT NULL, image VARCHAR(255) NOT NULL, hotAndCold TINYINT(1) DEFAULT false, createdAt DATETIME NOT NULL, updatedAt, listingDetails DATETIME NOT NULL, listingDetails TEXT, PRIMARY KEY (id));

 
  
 
  
 
  
  
  
  
  
  
  
  
  
  
  
 
  
  

  
  
  
  
  
  
  
  